INSERT INTO "public"."drills" ("id", "name", "skill_focus", "duration_minutes", "difficulty", "instructions", "created_at") VALUES
	('58d37826-7896-4892-b187-d6eec984b3d9', 'Fairway Finder Drill', 'Driving', 15, 'Beginner', 'Hit 10 drives aiming for a 30-yard-wide target zone. Focus on tempo and balance rather than distance.', '2025-10-15 22:21:38.980313'),
	('1a1ee5cd-b0ea-468f-947b-39a06fc8819f', 'Fairway Narrower', 'Driving', 20, 'Intermediate', 'Start with a 40-yard-wide target and narrow it by 5 yards each set. Forces focus on directional control.', '2025-10-15 22:21:38.980313'),
	('55098302-eb35-4d16-84d0-ff78c48e7c6d', 'Power Ladder', 'Driving', 20, 'Intermediate', 'Hit 5 drives each at 60%, 70%, 80%, 90%, and 100% effort. Track which speed yields the best balance of control and distance.', '2025-10-15 22:21:38.980313'),
	('194fc0ea-f257-4d02-b42d-3c94f9e0c578', 'Flight Window Challenge', 'Driving', 15, 'Advanced', 'Alternate between high, medium, and low trajectories. Helps learn to control launch and spin for different course conditions.', '2025-10-15 22:21:38.980313'),
	('843a6ffa-64e7-4371-82c1-6864859d38d7', 'Start Line Control', 'Driving', 15, 'Intermediate', 'Use alignment sticks to mark your intended start line. Record how many drives start within 5 yards of that line.', '2025-10-15 22:21:38.980313'),
	('eba53b67-903b-4776-b516-5f23f20a23ad', 'Draw vs Fade Control', 'Driving', 20, 'Advanced', 'Alternate shaping draws and fades on purpose. Track which side is more consistent and note tendencies.', '2025-10-15 22:21:38.980313'),
	('ba44d469-6fb4-4879-99f5-5d2bcb84d250', 'Impact Tape Feedback', 'Driving', 15, 'Beginner', 'Use face tape or foot spray to check strike pattern. Goal: hit 7 out of 10 drives from the center zone of the clubface.', '2025-10-15 22:21:38.980313'),
	('9664202f-28ac-471c-9d70-f7447d12cfff', 'Tempo Reset Drill', 'Driving', 10, 'Beginner', 'Count “1-2-3” during takeaway, downswing, and follow-through to keep tempo consistent under pressure.', '2025-10-15 22:21:38.980313'),
	('0ce51b56-27a6-4075-9d54-191480f57e98', 'Tee Height Test', 'Driving', 10, 'Beginner', 'Hit 3 drives at low, medium, and high tee heights. Find which height yields best launch and center strikes.', '2025-10-15 22:21:38.980313'),
	('6f80735e-cd5c-46f7-ab09-9bb947ff3aee', 'Pressure Drive Challenge', 'Driving', 15, 'Advanced', 'Simulate on-course pressure: pick a fairway, visualize the first tee, and hit one ball. If you miss, restart the count at zero. Try to make 5 in a row.', '2025-10-15 22:21:38.980313'),
	('c6eeb802-aec9-4109-b71d-0bf89efe9be1', 'Distance Ladder', 'Approach', 20, 'Beginner', 'Hit 5 shots each with 9-iron, 7-iron, and 5-iron. Focus on consistent carry gapping between clubs.', '2025-10-15 22:30:14.505654'),
	('0432735b-7430-4c0a-8c1c-6665e6590749', '3-Target Challenge', 'Approach', 15, 'Intermediate', 'Pick short, mid, and long targets. Rotate each shot between them to improve distance control and adaptability.', '2025-10-15 22:30:14.505654'),
	('4fdb33bb-1006-4cca-99b8-c3206b2cbe83', 'Trajectory Control Drill', 'Approach', 20, 'Advanced', 'Hit 5 balls with low, mid, and high trajectories using the same club. Learn to control ball flight in wind or under trees.', '2025-10-15 22:30:14.505654'),
	('e613d065-2690-439a-b0cd-5ce4142592ca', 'Pin Seeker', 'Approach', 15, 'Intermediate', 'Drop a random target yardage every round (e.g., 145y). Try to land within a 10-yard circle. Track how many hit target range.', '2025-10-15 22:30:14.505654'),
	('dcdae9aa-1fae-492c-b4b7-8a09a5252dbc', 'Club Gapping Calibration', 'Approach', 25, 'Beginner', 'Record carry distance for every iron (5-PW). Build a reliable gapping chart for on-course confidence.', '2025-10-15 22:30:14.505654'),
	('6e9e43ec-5203-47c5-9444-2a8ecff410e4', 'Start Line Gate', 'Approach', 15, 'Intermediate', 'Place two alignment sticks a few yards in front of the ball forming a “gate.” Hit through the gate without touching either stick.', '2025-10-15 22:30:14.505654'),
	('53592232-034a-4a7e-b8a8-37421c367933', 'Wind Adjustment Practice', 'Approach', 20, 'Advanced', 'Hit into a headwind and crosswind. Experiment with ball position and trajectory to control distance and curve.', '2025-10-15 22:30:14.505654'),
	('329f3c6b-80ee-49f3-962a-5bf696d8f1c5', '1-Ball Discipline Drill', 'Approach', 15, 'Advanced', 'Use only one ball and treat each shot like on the course. Pre-shot routine + full commitment = improved focus under pressure.', '2025-10-15 22:30:14.505654'),
	('f631eb54-c600-45e7-8809-e8a5b9c78b21', 'Tempo Meter Drill', 'Approach', 10, 'Beginner', 'Use a metronome or count “1-2-3” for takeaway, downswing, and follow-through. Trains rhythm for solid strikes.', '2025-10-15 22:30:14.505654'),
	('0ad28b81-5143-4415-b534-341b598caaa0', 'Miss Pattern Tracker', 'Approach', 15, 'Beginner', 'Hit 10 shots to a single target. Record where each misses (left, right, long, short). Identify your common pattern.', '2025-10-15 22:30:14.505654'),
	('e0726b33-7662-4476-b147-4d15126404d7', 'Up-and-Down Challenge', 'Short Game', 20, 'Intermediate', 'Drop 10 balls around the green. Try to get up-and-down (chip/pitch + 1 putt) at least 5 times.', '2025-10-15 22:31:00.944889'),
	('a3958cec-f2bf-4ada-9e94-5b5a143a1c47', 'Landing Zone Ladder', 'Short Game', 15, 'Intermediate', 'Mark 3 landing zones between you and the hole. Try to land the ball in each zone to control rollout.', '2025-10-15 22:31:00.944889'),
	('9b9266f0-c4b2-4130-b43c-2aa80bb56687', 'One Club Scramble', 'Short Game', 15, 'Advanced', 'Play 6 holes using only one wedge for all shots inside 50 yards. Forces creativity and feel.', '2025-10-15 22:31:00.944889'),
	('b21a7a73-c4f3-49eb-a9a2-8f99fd848fba', '10-Yard Ladder Drill', 'Short Game', 20, 'Beginner', 'Hit shots landing 10, 20, 30, 40, and 50 yards. Focus on consistent carry distance per swing length.', '2025-10-15 22:31:00.944889'),
	('5b7b1d9a-2717-41ee-a663-587fbe002883', 'Spin vs Roll Drill', 'Short Game', 15, 'Intermediate', 'Hit half shots with different wedges and trajectories. Observe which creates more spin or rollout.', '2025-10-15 22:31:00.944889'),
	('235c2ed9-2f8a-44dd-83f3-550588b2c416', 'Chipping Gate Drill', 'Short Game', 10, 'Beginner', 'Set two tees a few feet ahead forming a gate. Chip through without touching them to train start line.', '2025-10-15 22:31:00.944889'),
	('dce61652-64c1-45e8-a4d1-f4b79569d52a', 'Pressure Up-and-Downs', 'Short Game', 15, 'Advanced', 'Play 5 up-and-down scenarios and track success. Restart from zero if you miss two in a row.', '2025-10-15 22:31:00.944889'),
	('35122d92-fb38-4f0d-a7c4-5c1ed60c1a5d', 'Low vs High Shot Drill', 'Short Game', 20, 'Advanced', 'Alternate between low bump-and-run and high flop shots to learn trajectory control.', '2025-10-15 22:31:00.944889'),
	('9bb9246c-b499-4c8c-a461-5c84c64d0545', 'Fringe Speed Control', 'Short Game', 10, 'Beginner', 'Put from the fringe using different stroke lengths. Note how distance changes with tempo.', '2025-10-15 22:31:00.944889'),
	('8e43c132-af17-4e42-825c-ac4fc5c7d282', 'Rough Lie Challenge', 'Short Game', 15, 'Intermediate', 'Drop balls in the rough and hit 10 chips. Focus on consistent contact and reading lie depth.', '2025-10-15 22:31:00.944889'),
	('1c9fdacf-c64f-45aa-83bc-cd35fbb8597b', 'Clock Drill', 'Putting', 15, 'Beginner', 'Place 8 balls in a circle 3 feet from the hole like a clock. Make all 8 before moving back.', '2025-10-15 22:31:15.779903'),
	('9b9e9509-0102-4534-a6d0-66d4762485ba', 'Lag Distance Control', 'Putting', 20, 'Intermediate', 'Putt to targets 20, 30, and 40 feet away. Goal: stop within 3 feet of the hole.', '2025-10-15 22:31:15.779903'),
	('10635d64-16b6-4de3-b955-6012070b9116', 'Gate Drill', 'Putting', 10, 'Beginner', 'Set two tees slightly wider than your putter head and stroke through the gate for solid contact.', '2025-10-15 22:31:15.779903'),
	('7b46a25f-4429-4d7b-b327-1a7c8cc9e91a', 'Around the World', 'Putting', 15, 'Intermediate', 'Place 6 balls around the hole at 4 feet. Make all in a row before finishing the set.', '2025-10-15 22:31:15.779903'),
	('2c0400fc-0c87-43f2-84ac-a6988e69dc74', 'Pressure 3-Footer', 'Putting', 10, 'Advanced', 'Make 10 straight 3-footers. If you miss one, restart the count. Trains focus under pressure.', '2025-10-15 22:31:15.779903'),
	('29c96535-92d0-465e-b5a6-34c63f98a6c6', 'Ladder Drill', 'Putting', 15, 'Intermediate', 'Putt to 5 tees spaced 3 feet apart. Each putt must stop between the previous and next tee.', '2025-10-15 22:31:15.779903'),
	('269599fb-91f4-423e-a631-ffe390bdc7a0', 'One-Handed Stroke', 'Putting', 10, 'Beginner', 'Putt using only your right hand for 10 balls, then left hand. Trains feel and face control.', '2025-10-15 22:31:15.779903'),
	('33df75c4-bc08-4fa7-84cd-9234f6fb3f6e', 'Breaking Putt Reps', 'Putting', 20, 'Advanced', 'Find a 10-foot breaking putt. Hit 10 from each side and learn how the slope affects speed and aim.', '2025-10-15 22:31:15.779903'),
	('28cab4a9-65f3-4803-9128-0bfccdab4e5c', 'Eyes Closed Drill', 'Putting', 10, 'Intermediate', 'Hit 5 putts with eyes open, then 5 with eyes closed. Focus on feel and balance.', '2025-10-15 22:31:15.779903'),
	('25721fca-f2dd-4105-8c7c-da14f1c02638', 'Alignment Stick Accuracy', 'Driving', 15, 'Beginner', 'Place an alignment stick down your target line and practice hitting 10 drives starting along it to improve aim.', '2025-10-16 02:49:27.697679'),
	('055b0887-874f-44c0-98a8-fb5448c15e7f', 'Low Bullet Drill', 'Driving', 15, 'Intermediate', 'Practice hitting 10 low drives under an imaginary tree branch to learn trajectory control and forward shaft lean.', '2025-10-16 02:49:27.697679'),
	('b7fe8995-0537-4f8e-934d-7eddae0f238e', 'Fairway Fade Builder', 'Driving', 15, 'Advanced', 'Hit 5 drives aiming left edge and fading back to center. Work on clubface and path control.', '2025-10-16 02:49:27.697679'),
	('caefd613-0c06-4ba1-8485-01d9b11b8e8d', 'Controlled Draw Routine', 'Driving', 15, 'Advanced', 'Hit 5 drives starting right of target and drawing back. Focus on in-to-out path and face control.', '2025-10-16 02:49:27.697679'),
	('58aedd92-af37-41ff-b21b-92827a1e2dd9', 'Tempo Reset Routine', 'Driving', 10, 'Beginner', 'Swing at 70% for 5 balls, 80% for 5 balls, then 90% for 5 balls, maintaining rhythm and balance.', '2025-10-16 02:49:27.697679'),
	('8ed0e6f1-9f7c-4419-bf09-0224d9f8aa09', 'Nine-Shot Window', 'Approach', 15, 'Advanced', 'Hit 9 balls covering 3 trajectories (low, mid, high) and 3 shot shapes (fade, straight, draw).', '2025-10-16 02:49:27.697679'),
	('d3acf480-d5b9-4b4f-81be-f4319242a7f9', 'One-Club Challenge', 'Approach', 15, 'Intermediate', 'Use a single mid-iron (7i or 8i) to hit targets from multiple distances by varying swing length.', '2025-10-16 02:49:27.697679'),
	('c58986ad-8f50-4ebe-a8e3-616e5d0cb01e', 'Half-Swing Accuracy', 'Approach', 15, 'Beginner', 'Hit 10 controlled half-swings focusing on crisp contact and reduced dispersion.', '2025-10-16 02:49:27.697679'),
	('6fe3eabf-7525-45c8-b411-4883333bbe7a', 'Random Distance Generator', 'Approach', 15, 'Intermediate', 'Use a random number app to generate yardages between 100–180 and hit to each distance once.', '2025-10-16 02:49:27.697679'),
	('a3d5accb-843a-491e-8abd-529f42b6607c', 'Pressure Ladder Approaches', 'Approach', 15, 'Advanced', 'Move from 120→150→180→200 yards; if you miss target window, repeat previous distance.', '2025-10-16 02:49:27.697679'),
	('bd907732-dd7c-48c1-b945-e8a90a8a75c1', 'One-Bounce Stop', 'Short Game', 15, 'Advanced', 'Try to land chips that bounce once and stop near the hole; develop spin control and trajectory awareness.', '2025-10-16 02:49:27.697679'),
	('5f2ae15d-9441-462e-9a26-f6a47804f2de', 'Par-Save Circuit', 'Short Game', 15, 'Intermediate', 'Drop 5 balls around the green and try to get up-and-down from each; record how many successes.', '2025-10-16 02:49:27.697679'),
	('b608dca0-6327-4459-85f1-f6e8a4c98aab', 'Left-Hand-Only Chips', 'Short Game', 10, 'Beginner', 'Hit 10 chips with only your lead hand to improve feel and consistent strike.', '2025-10-16 02:49:27.697679'),
	('456f328b-f670-42d5-83f6-db1b0214a9ec', 'Towel Landing Zone', 'Short Game', 10, 'Intermediate', 'Lay down a towel as a landing target; chip 10 balls trying to land all on the towel.', '2025-10-16 02:49:27.697679'),
	('ec0d8980-9fca-4d7e-b301-dcd0af58de15', 'Spin vs Roll Experiment', 'Short Game', 15, 'Advanced', 'Use two different wedges and one 8-iron; compare rollout on 3 shots each to learn spin control.', '2025-10-16 02:49:27.697679'),
	('8878b054-fdd8-46ae-9be5-305c2f90b422', 'Eyes Closed Distance Drill', 'Putting', 10, 'Beginner', 'Hit 10 long putts with eyes closed to build feel for distance.', '2025-10-16 02:49:27.697679'),
	('b6bc3580-1c95-4ad3-b661-d7ef36183002', 'Gate to Gate Challenge', 'Putting', 15, 'Intermediate', 'Set one gate at impact and one 2 feet in front of ball; start and roll through both gates cleanly.', '2025-10-16 02:49:27.697679'),
	('adc2f0f5-3ecb-47ce-8317-16b1c37305b6', 'Ladder Lag Game', 'Putting', 15, 'Intermediate', 'Putt to markers at 10, 20, 30, 40 feet; each must stop short of the next target.', '2025-10-16 02:49:27.697679'),
	('04013f14-fcfd-4dd7-a56a-64d6afe187b9', 'Three-Hole Rotation', 'Putting', 15, 'Intermediate', 'Rotate through 3 different holes at varying slopes; 3 balls per hole focusing on green-reading.', '2025-10-16 02:49:27.697679'),
	('70d3e578-593b-4a7d-8044-c1444dd2bc87', 'Make-or-Restart Drill', 'Putting', 10, 'Advanced', 'Make 5 consecutive putts from 5 feet. If you miss, restart. Builds mental toughness.', '2025-10-16 02:49:27.697679');
