INSERT INTO "public"."practice_plans" ("id", "user_id", "name", "description", "is_global", "created_at") VALUES
	('6fc7f406-615f-462b-b6fe-202ebbf78b8c', NULL, 'Putting Mastery', 'A 45-minute putting session designed to improve start line, distance control, and pressure putting.', true, '2025-10-18 06:49:44.998011'),
	('67f24148-c206-406b-8afa-f8bb67a1b2d5', NULL, 'Short Game Mastery', 'A 45-minute focused session to master wedge control, recover from rough lies, and get up-and-down more often.', true, '2025-10-18 06:50:46.965543'),
	('88ae99cc-1e7f-442f-a6f9-fdf4e90d9478', NULL, 'Approach Precision', 'A 60-minute session focused on improving distance control, accuracy, and proximity to the hole.', true, '2025-10-18 06:52:01.662767'),
	('a766f1bf-c75c-47e6-98a4-7ad01521d3d9', NULL, 'Driving Power & Accuracy', 'A focused 60-minute session to build power, improve impact quality, and increase fairway accuracy.', true, '2025-10-18 06:53:34.854335');
