	('34a2534f-2cba-4d56-823c-310a4dacf799', '6fc7f406-615f-462b-b6fe-202ebbf78b8c', '2c0400fc-0c87-43f2-84ac-a6988e69dc74', 2, 'Build confidence on short putts under pressure.', '2025-10-18 06:49:44.998011'),
	('94a2e831-59ae-40ab-8654-bc9365f7e3fd', '6fc7f406-615f-462b-b6fe-202ebbf78b8c', '7b46a25f-4429-4d7b-b327-1a7c8cc9e91a', 3, 'Test consistency from multiple angles.', '2025-10-18 06:49:44.998011'),
	('ce0abc2b-f2c3-4ce3-8155-72275996b59a', '6fc7f406-615f-462b-b6fe-202ebbf78b8c', '9b9e9509-0102-4534-a6d0-66d4762485ba', 4, 'Master long-putt speed and proximity.', '2025-10-18 06:49:44.998011'),
	('7b41882f-7751-4f4e-ac24-e063a0044eea', '67f24148-c206-406b-8afa-f8bb67a1b2d5', 'b21a7a73-c4f3-49eb-a9a2-8f99fd848fba', 1, 'Build precise distance control with wedges.', '2025-10-18 06:50:46.965543'),
	('0ae36cc5-453e-4355-aa5f-3391d7eeb5c5', '67f24148-c206-406b-8afa-f8bb67a1b2d5', 'e0726b33-7662-4476-b147-4d15126404d7', 2, 'Practice saving par from various lies.', '2025-10-18 06:50:46.965543'),
	('0ef60b3c-d987-4e50-8c1f-5c07ed08b9b1', '67f24148-c206-406b-8afa-f8bb67a1b2d5', '8e43c132-af17-4e42-825c-ac4fc5c7d282', 3, 'Improve contact and spin from deep grass.', '2025-10-18 06:50:46.965543'),
